import{_ as i}from"./plugin-vue_export-helper-c27b6911.js";import{r,o as t,c as n,a as e,d as o,e as s}from"./app-3d4993ca.js";const d={},c=s('<h1 id="interview-kun" tabindex="-1"><a class="header-anchor" href="#interview-kun" aria-hidden="true">#</a> Interview-Kun</h1><h2 id="介绍" tabindex="-1"><a class="header-anchor" href="#介绍" aria-hidden="true">#</a> 介绍</h2><p>Interview-Kun【面试鸡、面试坤(ji)、ikun】是一个程序员求职面试刷题神器，包含海量题目和答案，多看一眼，知识点就会在脑海中爆炸，希望你在练习1坤年基本功后，能够收获太美的offer！！！</p><p>持续维护的面试刷题仓库，帮你拿到满意 offer！⭐️ 最新Java面试题、前端面试题、C++面试题、Go面试题、Python面试题、测试面试题、运维面试题、后端面试题、操作系统面试题、计算机网络面试题、Redis面试题、MySQL数据库面试题、算法面试题、Spring面试题、JVM面试题、Java并发面试题、Linux面试题等几千道高频程序员求职必备八股文。💎💎💎</p><h2 id="为什么要创建该仓库" tabindex="-1"><a class="header-anchor" href="#为什么要创建该仓库" aria-hidden="true">#</a> 为什么要创建该仓库？</h2><p>苦于国内内卷的大环境，面试从八股化逐渐走向场景化，面试题越来越多，但是国内很多能学到点东西的网站都是知识付费的模式，作为程序员，热爱开源，开源万岁！！！</p><p>当面试鸭承诺题目永久免费的时候，我知道，我该做点什么了，借鱼皮大佬的面试鸭的题目，来为所有程序员提供一个<strong>题目海量，答案全开源，答案高质量</strong>的仓库，让【Interview-Kun】成为每个程序员温暖的港湾！！！</p><h2 id="欢迎共同维护" tabindex="-1"><a class="header-anchor" href="#欢迎共同维护" aria-hidden="true">#</a> 欢迎共同维护</h2><p>欢迎大家向本仓库提交PR，<strong>共同维护开源的Interview-Kun</strong>！！！</p><p>比较<strong>希望各位大神优先贡献重难点题目，如场景题，系统设计题等</strong>，相信基础部分，大家都能够手拿把掐，轻松拿捏</p><p>合并的代码，我会部署到网站：https://eddie-lucas.github.io/interviewKun</p><p>开源不易，请多多star！！！可以放在自己的简历上，为自己的简历润色</p><h2 id="如何维护" tabindex="-1"><a class="header-anchor" href="#如何维护" aria-hidden="true">#</a> 如何维护？</h2><p>首先，相同内容的放在相同内容的文件夹下， 每个文件夹下仅有一个同名的markdown文件，如果没有你需要的文件夹，可以创建一个新的文件夹以及同名markdown文件，可以参考一下【后端场景面试题】的写法</p><p>另外，如果你需要上传图片，可以在文件夹下与markdown文件平级建一个img目录，然后将图片放在里面，并且在markdown中以相对路径引入，后续合并的时候，我会上传到我的图床上</p><p>提交PR之前看看网站上有没有自己的题目，如果有更好的答案，可以在题目下方形成多个不同的版本（需要做好区分）</p><p>面试题目来源可以参考面试题目永久免费的面试鸭：https://www.mianshiya.com</p><p>另外，<strong>如果你有其他的更好的题目，也可以贡献出来</strong></p><p>建议文件夹划分以及题目，难度划分跟面试鸭保持同步，如下图</p><figure><img src="https://gitee.com/eddie-lucas/images/raw/master/img/image-20241107205521409.png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><figure><img src="https://gitee.com/eddie-lucas/images/raw/master/img/image-20241108193332511.png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><h2 id="star-趋势" tabindex="-1"><a class="header-anchor" href="#star-趋势" aria-hidden="true">#</a> Star 趋势</h2>',22),h={href:"https://star-history.com/#eddie-lucas/interviewKun&Date",target:"_blank",rel:"noopener noreferrer"},p=e("img",{src:"https://api.star-history.com/svg?repos=eddie-lucas/interviewKun&type=Date",alt:"",tabindex:"0",loading:"lazy"},null,-1),l=e("figcaption",null,null,-1);function g(u,m){const a=r("ExternalLinkIcon");return t(),n("div",null,[c,e("figure",null,[e("a",h,[p,o(a)]),l])])}const w=i(d,[["render",g],["__file","index.html.vue"]]);export{w as default};
